  - name: TEXT4000
    number: '6'
    value: 'Mr. Vuong: Please be advised that Line 12 of the partys report discloses
      negative memo entries related to a transfer of joint fundraising proceeds. The
      party disclosed excessive contributions from these individuals that were received
      through a joint fundraiser on previous reports. The joint fundraiser reduced
      the transfer of joint fundraising proceeds on this report by the excessive amount
      of those contributions rather than having the party transfer the funds back
      to the joint fundraiser to correct the excessive contributions. The party will
      take similar action to correct the excessive transfer from Deborah Lanni. Please
      be advised that the offsets from individuals and political committee disclosed
      on Line 15 relate to transportation at the national convention that the party
      provided to these individuals and entities. The payments represent the usual
      and normal charge for these services. Please note that the disbursement to Coleman
      for Senate for office rent represents the usual and normal charge. Please be
      advised that the payments to individuals for rent on Schedules B and H4 are
      not reimbursements. The payments were made to individuals who own the offices
      rented by the party.  Please be advised that payments to the original vendor
      supporting the reimbursement to Rebecca Alery did not exceed $200 in a calendar
      year.'
